    "Tell other learners a little about yourself: where you live, what your interests are, why you're taking courses, or what you hope to learn.": "\u0411\u0430\u0441\u049b\u0430 \u043e\u049b\u0443\u0448\u044b\u043b\u0430\u0440\u0493\u0430 \u04e9\u0437\u0456\u04a3\u0456\u0437 \u0442\u0443\u0440\u0430\u043b\u044b \u049b\u044b\u0441\u049b\u0430 \u0434\u0430 \u043d\u04b1\u0441\u049b\u0430 \u0430\u0439\u0442\u0442\u044b\u043f \u0431\u0435\u0440\u0456\u04a3\u0456\u0437:\u049b\u0430\u0439\u0434\u0430 \u0442\u04b1\u0440\u0430\u0441\u044b\u0437,\u0441\u0456\u0437\u0434\u0456 \u043d\u0435 \u049b\u044b\u0437\u044b\u049b\u0442\u044b\u0440\u0430\u0434\u044b,\u043d\u0435\u0433\u0435 \u043a\u0443\u0440\u0441\u0442\u0430\u0440\u0434\u0430\u043d \u04e9\u0442\u043a\u0435\u043b\u0456 \u0436\u0430\u0442\u044b\u0440\u0441\u044b\u0437,\u043d\u0435\u043c\u0435\u0441\u0435 \u043d\u0435\u043d\u0456 \u043e\u049b\u044b\u043f-\u04af\u0439\u0440\u0435\u043d\u0443\u0434\u0456 \u04af\u043c\u0456\u0442\u0442\u0435\u043d\u0435\u0441\u0456\u0437.", 
