    "Textbook name is required": "\u041e\u049b\u0443 \u049b\u04b1\u0440\u0430\u043b\u044b\u043d\u044b\u04a3 \u0430\u0442\u044b \u0442\u0430\u043b\u0430\u043f \u0435\u0442\u0456\u043b\u0435\u0434\u0456", 
    "The URL you entered seems to be an email address. Do you want to add the required mailto: prefix?": "\u0421\u0456\u0437 \u0435\u043d\u0433\u0456\u0437\u0433\u0435\u043d URL \u043c\u0435\u043a\u0435\u043d-\u0436\u0430\u0439\u044b \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u0434\u044b\u049b \u043f\u043e\u0448\u0442\u0430 \u0431\u043e\u043b\u044b\u043f \u043a\u04e9\u0440\u0456\u043d\u0435\u0434\u0456.  \u049a\u0430\u0436\u0435\u0442\u0442\u0456 mailto: prefix \u049b\u043e\u0441\u0443\u0434\u044b \u049b\u0430\u043b\u0430\u0439\u0441\u044b\u0437 \u0431\u0430?", 
    "The URL you entered seems to be an external link. Do you want to add the required http:// prefix?": "\u0421\u0456\u0437 \u0435\u043d\u0433\u0456\u0437\u0433\u0435\u043d URL \u0441\u044b\u0440\u0442\u049b\u044b \u0441\u0456\u043b\u0442\u0435\u043c\u0435 \u0431\u043e\u043b\u044b\u043f \u043a\u04e9\u0440\u0456\u043d\u0435\u0434\u0456. \u049a\u0430\u0436\u0435\u0442\u0442\u0456 http:// prefix \u049b\u043e\u0441\u0443\u0434\u044b \u049b\u0430\u043b\u0430\u0439\u0441\u044b\u0437 \u0431\u0430?", 
    "The country that team members primarily identify with.": "\u0422\u043e\u043f \u043c\u04af\u0448\u0435\u043b\u0435\u0440\u0456 \u0435\u04a3 \u0430\u043b\u0434\u044b\u043c\u0435\u043d \u04e9\u0437\u0456\u043c\u0435\u043d \u0441\u04d9\u0439\u043a\u0435\u0441\u0442\u0435\u043d\u0434\u0456\u0440\u0435\u0442\u0456\u043d \u0435\u043b.", 
    "The course end date must be later than the course start date.": "\u041a\u0443\u0440\u0441\u0442\u044b\u04a3 \u0430\u044f\u049b\u0442\u0430\u043b\u0443 \u043a\u04af\u043d\u0456 \u0431\u0430\u0441\u0442\u0430\u043b\u0443 \u043a\u04af\u043d\u0456\u043d\u0435\u043d \u043a\u0435\u0439\u0456\u043d \u0431\u043e\u043b\u0443 \u043a\u0435\u0440\u0435\u043a.", 
    "The course must have an assigned start date.": "\u0422\u0430\u0493\u0430\u0439\u044b\u043d\u0434\u0430\u043b\u0493\u0430\u043d \u0431\u0430\u0441\u0442\u0430\u043b\u0443 \u043a\u04af\u043d\u0456 \u0431\u043e\u043b\u0443\u044b \u0442\u0438\u0456\u0441. ", 
    "The course start date must be later than the enrollment start date.": "\u041a\u0443\u0440\u0441\u0442\u044b\u04a3 \u0431\u0430\u0441\u0442\u0430\u043b\u0443 \u043a\u04af\u043d\u0456 \u0442\u0456\u0440\u043a\u0435\u0443 \u0431\u0430\u0441\u0442\u0430\u043b\u0443 \u043a\u04af\u043d\u0456\u043d\u0435\u043d \u043a\u0435\u0439\u0456\u043d \u0431\u043e\u043b\u0443 \u043a\u0435\u0440\u0435\u043a .", 
