    "The following email addresses and/or usernames are invalid:": "\u041c\u044b\u043d\u0430\u0434\u0430\u0439 \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u0434\u044b\u049b \u043f\u043e\u0447\u0442\u0430 \u043c\u0435\u043a\u0435\u043d\u0436\u0430\u0439\u043b\u0430\u0440\u044b \u0436\u04d9\u043d\u0435/\u043d\u0435\u043c\u0435\u0441\u0435 \u0430\u0442\u0442\u0430\u0440\u044b \u0436\u0430\u0440\u0430\u043c\u0441\u044b\u0437:", 
