    "The grading process is still running. Refresh the page to see updates.": "\u0411\u0430\u0493\u0430\u043b\u0430\u0443 \u043f\u0440\u043e\u0446\u0435\u0441\u0456 \u04d9\u043b\u0456 \u043e\u0440\u044b\u043d\u0434\u0430\u043b\u0443\u0434\u0430. \u0416\u0430\u04a3\u0430\u0440\u0442\u0443\u043b\u0430\u0440\u0434\u044b \u043a\u04e9\u0440\u0443 \u04af\u0448\u0456\u043d \u0431\u0435\u0442\u0442\u0456 \u0436\u0430\u04a3\u0430\u0440\u0442\u044b\u04a3\u044b\u0437.", 
    "The language that team members primarily use to communicate with each other.": "\u0422\u043e\u043f \u043c\u04af\u0448\u0435\u043b\u0435\u0440\u0456 \u0435\u04a3 \u0430\u043b\u0434\u044b\u043c\u0435\u043d \u0431\u0456\u0440-\u0431\u0456\u0440\u0456\u043c\u0435\u043d \u049b\u0430\u0440\u044b\u043c-\u049b\u0430\u0442\u044b\u043d\u0430\u0441 \u04af\u0448\u0456\u043d \u043f\u0430\u0439\u0434\u0430\u043b\u0430\u043d\u0430\u0442\u044b\u043d \u0442\u0456\u043b.", 
