    "There has been a failure to export to XML at least one component. It is recommended that you go to the edit page and repair the error before attempting another export. Please check that all components on the page are valid and do not display any error messages.": "XML \u044d\u043a\u0441\u043f\u043e\u0440\u0442\u0442\u0430\u0443 \u04af\u0448\u0456\u043d \u0431\u0430\u0441 \u0442\u0430\u0440\u0442\u0443 , \u043a\u0435\u043c \u0434\u0435\u0433\u0435\u043d\u0434\u0435 \u0431\u0456\u0440 \u049b\u04b1\u0440\u0430\u043c\u0434\u0430\u0441 \u0431\u043e\u043b\u0434\u044b . \u041e\u043b \u0441\u0456\u0437\u0433\u0435 \u0431\u0435\u0442\u0442\u0456 \u04e9\u04a3\u0434\u0435\u0443\u0434\u0456 \u0436\u04d9\u043d\u0435 \u043e\u0434\u0430\u043d \u0434\u0430 \u043a\u04e9\u043f \u044d\u043a\u0441\u043f\u043e\u0440\u0442\u0442\u0430\u0443\u0493\u0430 \u0442\u044b\u0440\u044b\u0441\u044b\u043f \u049b\u0430\u0442\u0435\u043d\u0456 \u0442\u04af\u0437\u0435\u0442\u0443\u0434\u0456 \u04b1\u0441\u044b\u043d\u0430\u0434\u044b. Please check that all components on the page are valid and do not display any error messages.", 
    "There has been an error while exporting.": "\u042d\u043a\u0441\u043f\u043e\u0440\u0442\u0442\u0430\u0443 \u043a\u0435\u0437\u0456\u043d\u0434\u0435 \u049b\u0430\u0442\u0435 \u043f\u0430\u0439\u0434\u0430 \u0431\u043e\u043b\u0434\u044b .", 
    "There is no email history for this course.": "\u041e\u0441\u044b \u043a\u0443\u0440\u0441 \u04af\u0448\u0456\u043d \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u0434\u044b\u049b \u0445\u0430\u0442 \u0430\u043b\u043c\u0430\u0441\u0443 \u0442\u0430\u0440\u0438\u0445\u044b \u0436\u043e\u049b.", 
