    "There was an error obtaining email task history for this course.": "\u041e\u0441\u044b \u043a\u0443\u0440\u0441 \u04af\u0448\u0456\u043d \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u0434\u044b\u049b \u0445\u0430\u0442 \u0430\u043b\u043c\u0430\u0441\u0443 \u0442\u0430\u0440\u0438\u0445\u044b \u0436\u043e\u049b.", 
